import Link from 'next/link';
import Button from 'react-bootstrap/Button';
import Navbar from "react-bootstrap/Navbar";
import Container from 'react-bootstrap/Container';
const services_array = ["Prabhakar Mishra", "Solutions", "Projects", "Gear", "Music", "Contact Me"];

const styles = {
  linkStyle : {
    marginRight: 15,
    color : "grey",
  },
  NavStyle : {
    "background-color" : "grey",
  }
}
const Header = () => {
  return (
    <Navbar bg="grey" sticky="top" expand="lg" style={styles.NavStyle}>
      {services_array.map(service => (
        <Container>
        <Link href={`/${(service.replace(" Me", '')).replace("Prabhakar Mishra", '')}`}>
          <a variant="outline-dark" style={styles.linkStyle}>{service}</a>
        </Link>
        </Container>
    ))}
  </Navbar>
);
}

export default Header



